import { Link } from 'react-router-dom';
import classes from'./Nav.css';

function MainNavigation(){
    return
       <nav className={classes.navBar}>

        <ul>
            <li ><Link to='/'>Home</Link></li>
            <li ><Link to='/About'>About</Link></li>


        </ul>
       </nav>

}
export default MainNavigation;
